import React from 'react';
import styled from "styled-components";

const Wrapper = styled.div`
    width: 100%;
    height: auto;
    max-eight: 100%;
    padding: 2px;
@media only screen and (min-width: 992px){
    width: 32.5%;
}
    `;

const Column_Thin = (props)=>(
    <Wrapper>
        {props.children}
    </Wrapper>
)

export default Column_Thin;
